import React, { Component } from 'react';
import './TodoItem.css';

export default class TodoList extends Component{
    render(){
        const {item} = this.props;
        let className = 'TodoItem';
        if (item.isComplete){
            className += ' TodoItem-complete';
        }
        //?TODO:npm classname
        return(
            <div className={className}>
                <p>{this.props.item.title}</p>
            </div>
        )
    }
}
